                      </p>
                    </div>
                </Modal>
              </TableCell>
              <TableCell><Button variant="contained" color="secondary" onClick={()=>this.onClickDelete(category.id)}>Delete</Button></TableCell>
              </TableRow>
          })}
        </TableBody>
      </Table>
    </TableContainer>
    </Paper>
  );
  }
}
